CREATE TABLE IF NOT EXISTS order_detail (
    "id" TEXT,
    "customer_id" TEXT,
    "order_date" DATE,
    "sku_id" TEXT,
    "price" INT,
    "qty_ordered" INT,
    "before_discount" FLOAT,
    "discount_amount" FLOAT,
    "after_discount" FLOAT,
    "is_gross" INT,
    "is_valid" INT,
    "is_net" INT,
    "payment_id" INT
);
